import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <div style={{display:'flex',padding:'0.5',background:'black'}}>
        <h1>Movies app</h1>
        <h2 style={{marginLeft:'2rem',marginTop:'1.5rem',color:'white'}}>favourites</h2>
      </div>
    )
  }
}
